import { Link } from "react-router-dom";
import Logo from "../../Logo/Logo";

interface FormWrapperProps {

    children?: React.ReactNode;
    heading: string;
    withLink?: boolean;
    link?: string;

}

const FormWrapper: React.FC<FormWrapperProps> = ({ children, heading, withLink, link }) => {
    const backButton = withLink && link ? (
        <Link to={link} className="hover:underline flex items-center my-2 text-xl text-gray-500 gap-2">
            <i className="fa-solid fa-arrow-left"></i>Voltar
        </Link>
    ) : null;

    return (
        <section className="flex flex-col items-center justify-center gap-3">
            <Logo />
            <section className="flex flex-col w-full md:w-3/4 lg:w-3/6 shadow-xl h-auto p-10 rounded">
                {backButton}
                <h3 className="text-heading-blue-800 text-3xl font-bold">{heading}</h3>
                {children}
            </section>
        </section>
    );
}

export default FormWrapper;
